export default function Basal()
{
    return (
        <div>
            <h1>평소 활동량을 선택하세요.</h1>
            <form>

                   <p>
                   <label>활동량이 거의 없다(좌식생활을 하고 운동을 안함)</label>
                    <input type="radio" value="1.2"/>
                   </p>


                    <p><input type="submit" value="저장">저장</input></p>
            </form>
        </div>
    );
}
